import React, { useState } from 'react';
import { action } from '@storybook/addon-actions';
import { BrowserRouter } from 'react-router-dom'
import CheckBox from '@material-ui/core/Checkbox';
import CustomCheckBox from '../components/Icons/customCheckbox';
import CheckboxChecked from '../components/Icons/checkboxChecked'




export default {
  title: 'CheckBox',
  component: CheckBox,
};

export function CheckBoxContainer({
  label,
  show,
  id,
  checboxChange,
  shouldDisable,
  resultCount,
  intermediate,
  multi = false,
}) {

  const classes = styles();
  const disable = shouldDisable.disable && shouldDisable.id === id;

  return (
    <BrowserRouter>
      <h3>Checkbox Group</h3>
      <Checkbox
        checked={show}
        disabled={disable}
        indeterminate={intermediate}
        onChange={e => (checboxChange ? checboxChange(e, id) : null)}
        className={classes.listItemChkbox}
        icon={<CustomCheckBox />}
        checkedIcon={<CheckboxChecked disabled={disable} />}
        indeterminateIcon={<IntermediateCheckbox />}
      />
    </BrowserRouter>
  );
}
